import React from 'react'
import Friends from './Friends'
import './Friends.css'

function FriendsList(props) {
    return(
        <div className="card">
             {props.friendsList.map( friend => {
                 return <Friends friend={friend} />
             })}
        </div> //end div
    )
}

export default FriendsList;
